<!DOCTYPE html>
<html lang="ru">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>NeryxeTag</title>
    <style>
        body {
            display: flex;
            justify-content: center;
            align-items: center;
            min-height: 100vh;
            background: linear-gradient(135deg, #202124 0%, #202124 100%);
            margin: 0;
            padding: 20px;
            box-sizing: border-box;
        }
        .container {
            position: relative;
            width: 100%;
            max-width: 800px;
            aspect-ratio: auto;
            display: flex;
            justify-content: center;
            align-items: center;
            flex-direction: column;
        }
        img {
            max-width: 100%;
            max-height: 90vh;
            width: auto;
            height: auto;
            object-fit: contain;
            cursor: pointer;
            border-radius: 15px;
            box-shadow: 0 0 30px rgba(147, 112, 219, 0);
        }
        img:hover {
            box-shadow: 0 0 40px rgba(147, 112, 219, 0);
        }
        @keyframes pulse {
            0% { box-shadow: 0 0 30px rgba(147, 112, 219, 0.3); }
            50% { box-shadow: 0 0 50px rgba(147, 112, 219, 0.5); }
            100% { box-shadow: 0 0 30px rgba(147, 112, 219, 0.3); }
        }
        img:active {
        }

        .telegram-button {
            width: 60px;
            height: 60px;
            border-radius: 50%;
            background: linear-gradient(45deg, #8ab4f8, #8ab4f8);
            display: flex;
            justify-content: center;
            align-items: center;
            cursor: pointer;
            transition: all 0.3s ease;
            margin-top: 20px;
        }

            .telegram-button:hover {
                box-shadow: 0 0 30px rgba(147, 112, 219, 0);
            }

            .telegram-button svg {
                color: white;
                filter: drop-shadow(0 0 5px rgba(255, 0, 0, 0));
            }

        @keyframes float {
            0% {
                transform: translateY(0px);
            }

            50% {
                transform: translateY(-10px);
            }

            100% {
                transform: translateY(0px);
            }
        }

        .telegram-button {
        }

        /* Стили для модального окна */
        .modal-overlay {
            display: none;
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            backdrop-filter: blur(2px);
            z-index: 1000;
            animation: fadeIn 0.3s ease;
        }

        .modal-content {
            position: fixed;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            background: rgba(32, 33, 36, 0.9);
            padding: 30px;
            border-radius: 20px;
            max-width: 500px;
            width: 90%;
            z-index: 1001;
        }
        @keyframes fadeIn {
            from { opacity: 0; }
            to { opacity: 1; }
        }

        @keyframes modalSlide {
            from {
                transform: translate(-50%, -60%);
                opacity: 0;
            }
            to {
                transform: translate(-50%, -50%);
                opacity: 1;
            }
        }
        .channels-grid {
            display: grid;
            grid-template-columns: repeat(auto-fill, minmax(150px, 1fr));
            gap: 15px;
            margin-top: 20px;
        }

        .channel-button {
            background: linear-gradient(f00e, #F00, #F00);
            color: white;
            padding: 12px 20px;
            border-radius: 15px;
            text-decoration: none;
            text-align: center;
            transition: all 0.3s ease;
            box-shadow: 0 0 15px rgb(255, 0, 0, 0,0);
            display: flex;
            align-items: center;
            justify-content: center;
            gap: 10px;
        }

            .channel-button:hover {
                box-shadow: 0 0 25px rgba(147, 112, 219, 0);
            }

        .modal-title {
            color: #fff;
            text-align: center;
            margin-bottom: 20px;
            font-size: 1.5em;
            text-shadow: 0 0 10px rgba(147, 112, 219, 0);
        }

        .label-grid {
            display: grid;
            grid-template-columns: repeat(auto-fill, minmax(150px, 1fr));
            gap: 15px;
            margin-top: 20px;
        }

        .label {
            color: #fff;
            text-align: left;
            margin-bottom: 20px;
            font-size: 1em;
            text-shadow: 0 0 10px rgba(147, 112, 219, 0);
        }

    </style>
</head>

    <div class="modal-overlay" id="channelsModal">
        <div class="modal-content">
            <h2 class="modal-title">Telegram Channels</h2>
            <div class="channels-grid"></div>
        </div>
    </div>

    <div class="body" id="label">
        <div class="label">
            <h2 class="label">NeryxeTag</h2>
            <div class="label-grid"></div>
        </div>
    </div>

    <script>
        const audio = document.getElementById("myAudio");
        const image = document.getElementById("myImage");
        const modal = document.querySelector('.modal-overlay');
        const label = document.getElementById('.label-grid');
        const channelsGrid = document.querySelector('.channels-grid');

        const channels = [
            'https://t.me/neryxetag',
            'https://t.me/neryxesoft'
        ];


        function createChannelButtons() {
            channelsGrid.innerHTML = channels.map(channel => {
                let channelName = channel.replace('https://t.me/', '');
                if (channelName === "NeryxeTag") {
                    channelName = "NeryxeTag OFF";
                }
                return `
                        <a href="${channel}" class="channel-button" target="_blank">
                            <svg viewBox="0 0 24 24" width="20" height="20">
                                <path fill="currentColor" d="M12 2C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm4.64 6.8c-.15 1.58-.8 5.42-1.13 7.19-.14.75-.42 1-.68 1.03-.58.05-1.02-.38-1.58-.75-.88-.58-1.38-.94-2.23-1.5-.99-.65-.35-1.01.22-1.59.15-.15 2.71-2.48 2.76-2.69.01-.03.01-.14-.07-.2-.08-.06-.19-.04-.27-.02-.11.02-1.93 1.23-5.46 3.62-.51.35-.98.52-1.4.51-.46-.01-1.35-.26-2.01-.48-.81-.27-1.46-.42-1.4-.88.03-.25.38-.51 1.07-.78 4.2-1.82 7-3.03 8.4-3.61 4-.17 4.83 1.16 4.88 1.15z"/>
                            </svg>
                            ${channelName}
                        </a>
                    `;
            }).join('');
        }

        image.addEventListener("click", function () {
            audio.play();
        });
        createChannelButtons();

        document.getElementById('showChannels').addEventListener('click', function (e) {
            e.preventDefault();
            modal.style.display = 'block';
        });

        modal.addEventListener('click', function (e) {
            if (e.target === modal) {
                modal.style.display = 'none';
            }
        });
    </script>
